import React from "react";
import "./App.css";
import NavBar from "./components/NavBar";
import Dots from "./components/Dots";
import Card from "./components/Card";

function App() {
  return (
    <div className="App">
      <NavBar />
      <Dots />
      <Card>Vraj Shah</Card>
    </div>
  );
}

export default App;
